FLUIGCTemplates["carousel-basic"] = "<script type=\"text/template\" class=\"template_carousel_basic\">\n" +
   "\n" +
   "<div id=\"{{id}}\" class=\"carousel slide\" data-ride=\"carousel\" data-interval=\"{{interval}}\" style=\"height: {{maxHeight}}; overflow: hidden;\">\n" +
   "<!-- Indicators -->\n" +
   "	{{#indicators}}\n" +
   "		<ol class=\"carousel-indicators\">\n" +
   "			{{#images}}\n" +
   "				<li data-target=\"#{{id}}\" data-slide-to=\"{{index}}\" {{#startIndex}}class=\"active\"{{/startIndex}}></li>\n" +
   "			{{/images}}\n" +
   "		</ol>\n" +
   "	{{/indicators}}\n" +
   "\n" +
   "<!-- Wrapper for slides -->\n" +
   "	<div class=\"carousel-inner\" role=\"listbox\">\n" +
   "		{{#images}}\n" +
   "		<div class=\"item{{#startIndex}} active{{/startIndex}}\">\n" +
   "			{{#resize}}\n" +
   "				<img {{#linkhref}}data-img-carousel-link=\"{{linkhref}}\"{{/linkhref}} {{#linktarget}}data-img-carousel-target=\"{{linktarget}}\"{{/linktarget}} src=\"{{#src}}{{src}}{{/src}}\" alt=\"{{#alt}}{{alt}}{{/alt}}\" style=\"max-height: {{maxHeight}}; max-width: 100%; width: {{width}}; {{#linkhref}}cursor: pointer;{{/linkhref}}\">\n" +
   "			{{/resize}}\n" +
   "			{{^resize}}\n" +
   "				<img height=\"400px\" class=\"center-block img-responsive\" {{#linkhref}}data-img-carousel-link=\"{{linkhref}}\"{{/linkhref}} {{#linktarget}}data-img-carousel-target=\"{{linktarget}}\"{{/linktarget}} src=\"{{#src}}{{src}}{{/src}}\" alt=\"{{#alt}}{{alt}}{{/alt}}\" style=\"max-height:400px;{{#linkhref}}cursor: pointer;{{/linkhref}}\">\n" +
   "			{{/resize}}\n" +
   "			<div class=\"carousel-caption\">\n" +
   "				{{#template}}\n" +
   "					{{{template}}}\n" +
   "				{{/template}}\n" +
   "				{{^template}}\n" +
   "					{{#title}}<h3>{{title}}</h3>{{/title}}\n" +
   "					{{#description}}<p>{{description}}</p>{{/description}}\n" +
   "				{{/template}}\n" +
   "			</div>\n" +
   "		</div>\n" +
   "		{{/images}}\n" +
   "	</div>\n" +
   "\n" +
   "<!-- Controls -->\n" +
   "	<a class=\"left carousel-control\" href=\"#{{id}}\" role=\"button\" data-slide=\"prev\">\n" +
   "		<span class=\"fluigicon fluigicon-chevron-left\"></span>\n" +
   "		<span class=\"sr-only\">Previous</span>\n" +
   "	</a>\n" +
   "	<a class=\"right carousel-control\" href=\"#{{id}}\" role=\"button\" data-slide=\"next\">\n" +
   "		<span class=\"fluigicon fluigicon-chevron-right\"></span>\n" +
   "		<span class=\"sr-only\">Next</span>\n" +
   "	</a>\n" +
   "</div>\n" +
   "</script>\n" +
   "";

